"use client";
import React, { useState } from "react";

function BinaryStringToImage() {
  const [binaryString, setBinaryString] = useState("");
  const [imageSrc, setImageSrc] = useState("");

  setBinaryString(
    "data:image/png;base64,"
  );

  const handleBinaryStringChange = (event: any) => {
    setBinaryString(event.target.value);
  };

  const convertBinaryStringToImage = () => {
    try {
      // Create a Blob from the binary string
      const blob = new Blob([binaryString], { type: "image/png" });

      // Create a URL for the Blob
      const url = URL.createObjectURL(blob);

      // Set the URL as the source for the image
      setImageSrc(url);
    } catch (error) {
      console.error("Error converting binary string to image:", error);
    }
  };

  return (
    <div>
      <h1>Binary String to Image Converter</h1>
     
      <br />
      <button onClick={convertBinaryStringToImage}>Convert to Image</button>
      <br />
      {imageSrc && (
        <div>
          <h2>Converted Image</h2>
          <img src={imageSrc} alt="Converted Image" />
        </div>
      )}
    </div>
  );
}

export default BinaryStringToImage;
